   286	    function renderTabs(tabs) {
   287	        allTabs = tabs;
   288	        tabsContainer.innerHTML = '';
   289	        if (!tabs || tabs.length === 0) {
   290	            tabsContainer.innerHTML = '<span>No tabs found.</span>';
   291	            renameTabButton.disabled = true;
   292	            deleteTabButton.disabled = true;
   293	            activeTabId = null;
   294	            feedGrid.innerHTML = '<p>Create a tab to get started!</p>';
   295	            return;
   296	        }
   297	
   298	        tabs.sort((a, b) => a.order - b.order);
   299	
   300	        let firstTabId = null;
   301	        tabs.forEach((tab, index) => {
   302	            const button = document.createElement('button');
   303	            button.textContent = tab.name;
   304	            button.dataset.tabId = tab.id;
   305	            button.addEventListener('click', () => switchTab(tab.id));
   306	
   307	            const badge = createBadge(tab.unread_count);
   308	            if (badge) {
   309	                button.appendChild(badge);
   310	            }
   311	
   312	            tabsContainer.appendChild(button);
   313	
   314	            if (index === 0) {
   315	                firstTabId = tab.id;
   316	            }
   317	        });
   318	
   319	        renameTabButton.disabled = false;
   320	        deleteTabButton.disabled = tabs.length <= 1;

